import React from "react";
import { Link } from "react-router-dom";
const Header = () => {
  return (
    <div class="header">
      <div class="header_items">
        {" "}
        <a href="#"> Home </a> <a href="#"> Products </a>{" "}
        <a href="#"> About </a> <a href="#"> Help </a>{" "}
      </div>{" "}
      <div>
        <img src="../images/cart.png" alt="shape" />
      </div>{" "}
    </div>
  );
};
export default Header;
